import ContactForm from '../ContactForm/ContactForm';

const Contact = () => {
  return (
    <div className="main">
      <h2>Máte něco na srdci?</h2>
      <p>Jsem vám plně k dispozici. Máte jakékoli dotazy, sem s nimi! </p>

      <ContactForm />
    </div>
  );
};

export default Contact;
